/* Reset for consistency */
* { margin: 0; padding: 0; box-sizing: border-box; }
body { 
    font-family: 'Arial', sans-serif; 
    font-size: 16px; 
    line-height: 1.6;
    padding: 20px;
    max-width: 900px;
}

/* Typography */
h3 {
    font-size: 20px;
    margin-bottom: 12px;
    font-weight: bold;
}

p {
    margin-bottom: 16px;
}

/* Table styles */
table {
    border-collapse: collapse;
    width: 100%;
    margin: 16px 0;
}

th, td {
    border: 1px solid #d1d9e0;
    padding: 10px 12px;
    text-align: left;
    vertical-align: top;
}

th {
    background-color: #f6f8fa;
    font-weight: bold;
}

tr:nth-child(even) {
    background-color: #f9f9f9;
}

/* Column alignment */
.center { text-align: center; }
.right { text-align: right; }

/* Code in tables */
code {
    font-family: 'Courier New', monospace;
    font-size: 14px;
    background-color: #f3f4f6;
    padding: 2px 4px;
    border-radius: 3px;
}

/* Status indicators */
.status-active { 
    color: #059669; 
    font-weight: bold; 
}

.status-deprecated { 
    color: #dc2626; 
    font-weight: bold; 
}

.status-beta { 
    color: #d97706; 
    font-weight: bold; 
}
